import Home from "./Home";
import React from 'react'
import {Route, Routes, BrowserRouter} from 'react-router-dom';
import Python from "./Python";

function Pages() {
  return (
    <BrowserRouter>

    <Routes>
        <Route path="/" element={<Home/>}/>
        <Route path="/Python" element={<Python/>}/>
    </Routes>
    </BrowserRouter>
  );
}


export default Pages
